The Array.<T> type, also expressed as [T], is an unoptimized insertion-order collection of values. Indices are zero based. The following program demonstrates using the Array type: const list : [Number] = [10, 5]; // add a new element equivalent to first value + second value
list.push(list[0] + list[1]); trace("length:", list.length, "third value:", list[2]);
trace("enumerating values..."); for each (var val:Number in list)
{ trace("-", val);
} The program log should be: length: 3 third value: 15
enumerating values...
- 10
- 5
- 15

