The tuple type, expressed as two or more types between brackets, as in [Boolean, String], is a compile time type that is equivalent to Array, performing checks ahead of time for ensuring that the array consists of a certain sequence of elements of a specific type. The tuple type is useful for example when a function returns multiple values: function process(data:String):[Boolean, String]
{ trace("processing..."); var successful = true; var output = data.charAt(0); return [successful, output];
}

