The Function type represents a function or a bound method that you may call in ActionScript. In addition, a compile time type over Function allows you to ensure a function takes a specific sequence of parameters and that it returns a specific type: type TakeRest = function(...[String]):void;
type TakeOptBoolean = function(Boolean=):void;
type TakeInt = function(int):void;

